import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Attendees from './Pages/Attendees';
import TaskTracker from './Pages/TaskTracker'; // Fixed typo in the import name
import Event from './Pages/Event';
import Sidebar from './Pages/Sidebar';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        {/* Sidebar component outside the Routes for consistent display */}
        <Sidebar />

        {/* Define the application routes */}
        <Routes>
          <Route path="/event" element={<Event />} />
          <Route path="/tasktracker" element={<TaskTracker />} /> {/* Fixed the route path to match the component name */}
          <Route path="/attendees" element={<Attendees />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
